import * as React from "react";

import {
    StyleSheet,
    View,
    Button,
    Text,
    ScrollView,
    TouchableOpacity,
    TextInput,
    Image,
} from "react-native";

export default class UserScreen extends React.Component {
    constructor(props) {
        super(props)
    }
    render() {
        return (
            <View style={styles.container}>
              <Text
                style={{
                  color: "black",

                  textAlign: "center",
                  marginTop: 15,
                }}
              >
                {" "}
                <Ionicons
                  name="md-person"
                  size={40}
                  color="blue"
                  marginLeft={80}
                  alignItems="centre"
                />
              </Text>
              <Text
                style={{
                  color: "black",
                  fontSize: 28,
                  textAlign: "center",
                  marginTop: 5,
                }}
              >
                User
              </Text>
              <Text
                style={{
                  color: "black",
                  fontSize: 18,

                  marginTop: 35,
                }}
              >
                Email ID: <Ionicons name="md-book" size={32} color="blue" />
              </Text>
              <Text
                style={{
                  color: "black",
                  fontSize: 18,

                  marginTop: 35,
                }}
              >
                DID:
                <Ionicons name="md-book" size={32} color="blue" />
              </Text>
              <View>
                <TouchableOpacity
                  style={styles.button}
                  onPress={() => navigation.navigate("User")}
                >
                  <Text style={styles.buttonText}>
                    Edit{" "}
                    <Ionicons
                      name="md-checkmark"
                      size={20}
                      marginLeft={25}
                      color="#fff"
                    />
                  </Text>
                </TouchableOpacity>
              </View>
              {/* <Button
                title="Go to Details... again"
                onPress={() => navigation.push("Details")}
              /> */}
            </View>
          );
    }
  }
